import React from 'react';  // Import React
import { Route, BrowserRouter } from 'react-router-dom';  // Import Route and BrowserRouter
import Home from './pages/home';  // Import your components
//

function App() {
  return (
    <div className="App">
     <BrowserRouter>
       <Route path='/' exact component={Home} />

     </BrowserRouter>
    </div>
  );
}

export default App;
